- input: "TEXT\x1CC00001305\x1C.TEXT\x1C\x1CF3XA\x1CResponse to Commission Letter
    of June 10, 2011, reference the October Monthly Report (9/1/10 - 9/30/10):  Item
    1 - Description of Schedule B disbursements have been changed to reflect salary
    expense.  Item 2 - Report has been amended to disclose the identity of candidates
    for which FEA payments were made.  These expenditures do meet the definition of
    Federal Election Activity under 11CFR#100.24.  Item 3 - The Schedule B Line 30(b)
    disbursements listed on referenced FEC Letter represent volunteer activity that
    meets the definition of Exempt Party Activity as set forth in 11CFR100.87 and
    100.147, and the Interim Enforcement Policy (Notice 2010-XX) with regard to \"volunteer
    mail\" exemption.  Payments for these disbursements were made from permissable
    Federal funds, and did not include any designated candidate funds.  Transfers
    of funds from National Party Committees were not earmarked for this Exempt Party
    Activity, or for any particular candidate, program or purpose.\n"
